DROP table if exists depara_natureza;

CREATE TABLE depara_natureza
(
  id serial NOT NULL,
  natureza_certifico varchar(225),
  natureza_sinter varchar(225),
  subnatureza_sinter varchar(225),
  CONSTRAINT pk_depara_natureza PRIMARY KEY (id)
);

UPDATE natureza set nome = UPPER(nome);

begin;
update depara_natureza set natureza_sinter =
CASE
		WHEN natureza_sinter IN ('DOCUMENTO') THEN 'DOCUMENTO - OUTROS'
		WHEN natureza_sinter IN ('CONT. FISCAL OU ADMIN.','CONT. FISCAL OU ADM','DOCUMENTO FISCAL') THEN 'CONTÁBIL, FISCAL OU ADMINISTRATIVO'
		WHEN natureza_sinter IN ('DOC. DE TÍT. DE CRÉDITO','DOC. OU TIT. DE CRED','DOC. OU TÍTULO DE CRED') THEN 'DOCUMENTO OU TÍTULO DE CRÉDITO - OUTROS'
		WHEN natureza_sinter IN ('TRANS. DE PROP. OU DIREITOS') THEN 'TRANSMISSÃO DA PROPRIEDADE OU DE DIREITOS'
		WHEN natureza_sinter IN ('DOC. IND PESSOAL','DOC. DE IDENTIDADE') THEN 'DOCUMENTO DE IDENTIDADE/PESSOAL'
		WHEN natureza_sinter IN ('TRANS. DE PROP. OU DIREITOS','TRANSMISSÃO','TRANSM. DE DIREITOS') THEN 'TRANSMISSÃO DA PROPRIEDADE OU DE DIREITOS'
		WHEN natureza_sinter IN ('MANDATO') THEN 'MANDATO'
		WHEN natureza_sinter IN ('MATRIC. FUNDO DE INV.') THEN 'MATRÍCULA DE FUNDO DE INVESTIMENTO'
		WHEN natureza_sinter IN ('NOTIFICAÇÃO') THEN 'NOTIFICAÇÃO'
		WHEN natureza_sinter IN ('CONT. DE GARANTIA','CONTRATO DE GARANTIA') THEN 'CONTRATO DE GARANTIA'
		WHEN natureza_sinter IN ('CÉDULA DE CRÉDITO') THEN 'CÉDULA DE CRÉDITO'
		WHEN natureza_sinter IN ('MATRICULA FUNDO') THEN 'MATRÍCULA DE FUNDO DE INVESTIMENTO'
	ELSE natureza_sinter END

returning *;
commit;

DROP table if exists depara_natureza;

CREATE TABLE depara_natureza
(
  id serial NOT NULL,
  natureza_certifico varchar(225),
  natureza_sinter varchar(225),
  subnatureza_sinter varchar(225),
  CONSTRAINT pk_depara_natureza PRIMARY KEY (id)
);



