--insert into sub_natureza(id, nome, natureza_id) Values ('Alienação fiduciária',(select n.id from natureza n JOIN depara_natureza on natureza_sinter = nome and subnatureza_sinter = UPPER(subnatureza_sinter) limit 1));

--select * from sub_natureza;

begin;
update depara_natureza set subnatureza_sinter =
CASE
		WHEN subnatureza_sinter IN ('ARRENDAMENTO MERCANTIL') THEN 'ARRENDAMENTO MERCANTIL (LEASING)'
		WHEN subnatureza_sinter IN ('ATA') THEN 'ATA-REGISTRO'
		WHEN subnatureza_sinter IN ('CED. DE CRED RURAL PIGNORATICIA') THEN 'CÉDULA DE CRÉDITO RURAL HIPOTECÁRIA E PIGNORATÍCIA'

		WHEN subnatureza_sinter IN ('CEDULA DE CRED BANCARIO') THEN 'CÉDULA DE CRÉDITO BANCÁRIO'

		WHEN subnatureza_sinter IN ('CEDULA DE CRED COMERCIAL') THEN 'CÉDULA DE CRÉDITO COMERCIAL'

		WHEN subnatureza_sinter IN ('CEDULA DE CRED INDUSTRIAL') THEN 'CEDULA DE CRED INDUSTRIAL'

		WHEN subnatureza_sinter IN ('COMPROMISSO DE CESSÃO DIR') THEN 'COMPROMISSO DE CESSÃO DE DIREITOS'

		WHEN subnatureza_sinter IN ('CONTRATO PADRÃO') THEN 'CONTRATO-PADRÃO'

		WHEN subnatureza_sinter IN ('DOC. ESTUDANTIL') THEN 'DOCUMENTO ESTUDANTIL'
		WHEN subnatureza_sinter IN ('DOCUMENTO') THEN 'DOCUMENTO - OUTROS'
		WHEN subnatureza_sinter IN ('FIANÇA') THEN 'FIANÇA/AVAL'
		WHEN subnatureza_sinter IN ('LAUDO') THEN 'LAUDO/VISTORIA'


		WHEN subnatureza_sinter IN ('MUTUO') THEN 'MÚTUO'


		WHEN subnatureza_sinter IN ('NOTA PROMISSORIA') THEN 'NOTA PROMISSÓRIA'


		WHEN subnatureza_sinter IN ('SOC. EM CONTA DE PARTICIPAÇÃO') THEN 'SOCIEDADE EM CONTA DE PARTICIPAÇÃO'
		WHEN subnatureza_sinter IN ('SUBSTABELECIMENTO') THEN 'SUBSTABELECIMENTO - REGISTRO'
	ELSE subnatureza_sinter END;

commit;

UPDATE sub_natureza set nome = upper(nome);

UPDATE sub_natureza s set natureza_id = (select n.id from natureza n JOIN depara_natureza on natureza_sinter = nome and s.nome = UPPER(subnatureza_sinter) limit 1);


