INSERT INTO modelo (id,tipo_modelo_id,nome,modelo) VALUES
		   (52,1, 'REGISTRO MANUAL', 'REGISTRO: Certifico que foi apresentado este documento, com {{PAGINAS}} páginas, registrado sob o número [[NUMERO_REGISTRO]] em {{DATA_ATUAL}} neste 2º Oficial de Registro, Títulos e Documentos e Civil de Pessoa Jurídica de Osasco, possui o mesmo valor probante do original para todos os fins de Direito, seja em Juízo ou fora dele, nos termos dos artigos 161 da Lei n. 6.015/73 e 217 da Lei 10.406/02 e foi extraída sob forma de documento eletrônico devendo para validade ser conservada em meio eletrônico, bem como comprovada a autoria e integridade. Osasco, {{DATA_ATUAL_EXTENSO}}. {{NOME_CARTORIO}}, CNPJ {{CNPJ_CARTORIO}}. Certifico ainda, que a assinatura digital constante neste documento eletrônico está em conformidade com os padrões da ICP-Brasil, nos termos da Lei 11.977 de 07 de julho de 2009. {{CUSTAS}}');
INSERT INTO modelo (id,tipo_modelo_id,nome,modelo) VALUES
		   (53,1, 'REGISTRO ELETRÔNICO', 'REGISTRO ELETRÔNICO: Certifico que foi apresentado este documento, com {{PAGINAS}} páginas, registrado sob o número [[NUMERO_REGISTRO]] em {{DATA_ATUAL}} neste 2º Oficial de Registro, Títulos e Documentos e Civil de Pessoa Jurídica de Osasco, possui o mesmo valor probante do original para todos os fins de Direito, seja em Juízo ou fora dele, nos termos dos artigos 161 da Lei n. 6.015/73 e 217 da Lei 10.406/02 e foi extraída sob forma de documento eletrônico devendo para validade ser conservada em meio eletrônico, bem como comprovada a autoria e integridade. Osasco, {{DATA_ATUAL_EXTENSO}}. {{NOME_CARTORIO}}, CNPJ {{CNPJ_CARTORIO}}. Certifico ainda, que a assinatura digital constante neste documento eletrônico está em conformidade com os padrões da ICP-Brasil, nos termos da Lei 11.977 de 07 de julho de 2009. {{CUSTAS}}');
INSERT INTO modelo (id,tipo_modelo_id,nome,modelo) VALUES
		   (54,1, 'CARIMBO CERTIDÃO','CERTIDÃO DE REGISTRO: Certifico que a presente certidão é constituída de {{PAGINAS}} páginas e foi extraída do documento registrado sob número {{NUMERO_REGISTRO}}em {{DATA_ATUAL}} neste 2° Oficial de Registro de Títulos e Documentos e Civil de Pessoa Jurídica de Osasco. Certifico, ainda, que a presente certidão possui o mesmo valor probante do documento original para todos os fins de Direito, seja em Juízo ou fora dele, nos termos dos artigos 161 da Lei n. 6.015/73 e 217 da Lei 10.406/02, tendo sido extraída sob forma de documento eletrônico. Certifico, ainda, que a assinatura digital constante neste documento eletrônico é do 2° Oficial de Registro de Títulos e Documentos e Civil de Pessoa Jurídica de Osasco e está em conformidade com os padrões da ICP-Brasil, nos termos da Medida Provisória nº. 2.200-2, de 24 de agosto de 2001. Osasco, {{DATA_ATUAL_EXTENSO}}. {{NOME_CARTORIO}}, CNPJ {{CNPJ_CARTORIO}}.');
